scriptlet.script:
try {
    var docs = JSON.parse(document);
	if( docs.hasOwnProperty('subscriptionStatus') && docs['subscriptionStatus'].hasOwnProperty('name') )  {
		var status =  docs['subscriptionStatus']['name'];
                if(status === 'ACTIVE') {
                    scriptletResponse="true";
                }
                else {
                    scriptletResponse = (it < max) ? "false": "failure";
                    scriptletContext.put("it",it++);
                    scriptletContext.put("FailureMessage","Timeout. Expected Status: ACTIVE, Found:" + status);
                }
	}
	else {
            scriptletResponse = (it < max) ? "false": "failure";
            scriptletContext.put("it",it++);
            scriptletContext.put("FailureMessage","Timeout. Content: " + document);
	}
}
catch(e) {
	scriptletContext.put("FailureMessage",e.stack);
	scriptletResponse = "failure";
}
